import React, { Component } from "react";

class SignUp extends Component {
  state = {
    email: null,
    displayName: null,
    age: null,
    gender: null,
    looking_for: null,
    zipCode: null
  }

  handleChange = (e) => {
    const name = e.target.name
    this.setState({
      [name]: e.target.value
    })
    console.log(this.state)
  }

  render() {
    return (
      <form className="ui item">
        <label>Email</label>
        <input name="email" type="text" value={this.state.email} onChange={this.handleChange}></input>
        <label>Display Name</label>
        <input name="display_name" type="text" value={this.state.displayName} onChange={this.handleChange}></input>
        <label>Age</label>
        <input name="age" type="number" value={this.state.age} onChange={this.handleChange}></input>
        <label>Gender</label>
        <input name="gender" type="text" value={this.state.gender} onChange={this.handleChange}></input>
        <label>Zip Code</label>
        <input name="zip_code" type="text" value={this.state.zipCode} onChange={this.handleChange}></input>
      </form>
    );
  }
}

export default SignUp;
